import React from 'react';
import './componentcss.css';
import {connect} from 'react-redux';
import {rootConstants} from '../_constants';

class dataPrint extends React.Component {
    constructor() {
        super();
        this.handleClick = this.handleClick.bind(this);
        this.state = {
           data: []
        }
     }
     handleClick(person) {
         {this.props.increaseCounter()}
   }

    render() {

       return (
          <tr className={this.props.data.id} onClick={() => this.handleClick(this.props.data)}>
             <td>{this.props.data.index}-</td>
             <td>{this.props.data.lesson_name}-</td>
             <td>({this.props.data.kridit})-</td>
             <td>{this.props.data.season}</td>
             <td>{this.props.counter}</td>
          </tr>
       );
    }
 }
function mapStateToProps(state) {
   return {
      lessonData: state.lessonData,
      counter: state.counter
   }
}
function mapDispatchToProps(dispatch) {
   return {
       increaseCounter: () => dispatch({type: rootConstants.ROOT_REQUEST }),
   }
}



export default connect(mapStateToProps)(dataPrint);
